import React from "react";
import styled from "styled-components";
import Navigate from '../../navigate';
import NavList from "./NavList";

const Lists = styled.ul`

    position: fixed;
    top: 0;
    left: 0;
    height: 100vh;
    width: 100%;
    box-sizing: border-box;
    z-index: 100;
    background-color: hsla(0,0%,100%,.95);
    backdrop-filter: blur(10px);
    list-style: none;
    display: ${({openHamburger}) => openHamburger ? 'block' : 'none'}

    @media (min-width: 992px){
        display: flex;
        flex-direction: row;
        background-color: transparent;
        backdrop-filter: none;
        height: auto;
        position: static;
        top: 0;
        list-style: none;
        gap: 1em;
      }
`

function Navigation({scrolled, openHamburger}) {

    return (<nav>
        <Lists scrolled={scrolled}>
            {Navigate.map((nav, index) => {
            return(
                <NavList openHamburger={openHamburger} nav={nav} index={index} scrolled={scrolled} key={index}/>)
            })}
        </Lists>
    </nav>);
}

export default Navigation
